import React, { useEffect } from 'react';
import './App.css';
import { firebase } from './helpers/index';


function App() {


  useEffect(() => {
    firebase();
  }, []);


  return (
    <div className="App">
      <header className="App-header">


         <button onClick={firebase}> 
          run with firebase
        </button>

      </header>
    </div>
  );
}

export default App;
